INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(25, 'An Old Man', , 'Story', 'A moral short story about a man who lived in a village', 'An old man lived in the village. He was one of the most unfortunate people in the world. The whole village was tired of him; he was always gloomy, he constantly complained and was always in a bad mood.<br><br>\r\nThe longer he lived, the more bile he was becoming and the more poisonous were his words. People avoided him, because his misfortune became contagious. It was even unnatural and insulting to be happy next to him.\r\nHe created the feeling of unhappiness in others.<br><br>\r\nBut one day, when he turned eighty years old, an incredible thing happened. Instantly everyone started hearing the rumour:<br><br>\r\n<b>\"An Old Man is happy today, he doesn\'t complain about anything, smiles, and even his face is freshened up.\"</b>\r\n<br><br>\r\nThe whole village gathered together. The old man was asked:<br>\r\nVillager: What happened to you?<br><br>\r\n<b>\"Nothing special. Eighty years I\'ve been chasing happiness, and it was useless. And then I decided to live without happiness and just enjoy life. That\'s why I\'m happy now.\" - An Old Man</b>\r\n<br><br>\r\nMoral of the story:<br>\r\nDon\'t chase happiness. Enjoy your life.<br>', 'kaveen');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(26, 'The Lion and The Poor Slave', , 'Story', 'we get the rewards of our helpful acts in return.', 'A slave, ill-treated by his master, runs away to the forest. There he comes across a lion in pain because of a thorn in his paw. The slave bravely goes forward and removes the thorn gently.<br><br>\r\nThe lion without hurting him goes away.<br><br>\r\nSome days later, the slaveâ€™s master comes hunting to the forest and catches many animals and cages them. The slave is spotted by the mastersâ€™ men who catch him and bring him to the cruel master.<br><br>\r\nThe master asks for the slave to be thrown into the lionâ€™s cage.<br><br>\r\nThe slave is awaiting his death in the cage when he realizes that it is the same lion that he had helped. The slave rescued the lion and all other caged animals.<br><br>\r\n<b>Moral of the story:</b><br><br> \r\nOne should help others in need, we get the rewards of our helpful acts in return.<br>', 'shameera');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(27, 'Lorem Ipsum', , 'Article', 'What is lorem ipsum and why we use it?', '<b>What is Lorem Ipsum?</b><br><br>\r\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.<br><br><br>\r\n<b>Why do we use it?</b><br><br>\r\nIt is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose<br><br>', 'nirushana');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(28, 'The Foolish Donkey', , 'Story', 'Luck will not a favor all the times. Understanding the reality.', 'A salt seller used to carry the salt bag on his donkey to the market every day.<br><br>\r\nOn the way they had to cross a stream. One day the donkey suddenly tumbled down the stream and the salt bag also fell into the water. The salt dissolved in the water and hence the bag became very light to carry. The donkey was happy.<br><br>\r\nThen the donkey started to play the same trick every day.<br><br>\r\nThe salt seller came to understand the trick and decided to teach a lesson to it. The next day he loaded a cotton bag on the donkey.<br><br>\r\nAgain it played the same trick hoping that the cotton bag would be still become lighter.<br><br>\r\nBut the dampened cotton became very heavy to carry and the donkey suffered. It learnt a lesson. It didn\'t play the trick anymore after that day, and the seller was happy.<br><br>\r\n<b>Moral of the story:</b><br><br>\r\nLuck won\'t favor always.<br><br>', 'dante');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(30, 'Fair Warning', , 'Article', 'A short article you must read. A fair warning will be a life changer', 'Perhaps my fate was sealed when I sold my three-year-old sister. My father had taken me to a couple of cattle auctions, not minding that I was a girlâ€“this was before Missy was born, of courseâ€“and Iâ€™d loved the fast talk and the intensity of the whole thing. So the day after my seventh birthday party, where Missy did a song for everyone while I sat alone, my chin on my hand, and meditated behind my still uncut birthday cake, it seemed to me that here was a charming and beautiful little asset that I had no further use for and could be liquidated to good effect.<br><br>\r\nSo I gathered a passel of children from our gated community in Houston, kids with serious money, and I had Missy do a bit of her song once more, and I said, â€œLadies and gentlemen, no greater or more complete perfection of animal beauty ever stood on two legs than the little girl who stands before you. She has prizewinning breeding and good teeth. She will neither hook, kick, strike, nor bite you. She is the pride and joy and greatest treasure of the Dickerson family and she is now available to you.<br><br>\r\nWho will start the bidding for this future blue-ribbon winner? Whoâ€™ll offer fifty cents? Fifty cents. Whoâ€™ll give me fifty?â€ I saw nothing but blank stares before me. Iâ€™d gotten all these kids together but I still hadnâ€™t quite gotten them into the spirit of the thing. So I looked one of these kids in the eye and I said, â€œYou, Tony Speck. Arenâ€™t your parents rich enough to give you an allowance of fifty cents?â€ He made a hard, scrunched-up face and he said, â€œA dollar.â€ And I was off. I finally sold her for six dollars and twenty-five cents to a quiet girl up the street whose daddy was in oil. She was an only child, a thing I made her feel sorry about when the bidding slowed down at five bucks.', 'frank');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(31, 'Cream Cheese', , 'Pouch', 'The best recipe for cream cheese that you can find on the internet', '<center><table border=\"1\" cellpadding=\"10\">\r\n<tr><td><h3>ingrediants:</h3>\r\n<i>1: Milk - 4cups</i><br>\r\n<i>2: Lemon - 3tbsp</i><br><br>\r\n<h3>Method:</h3>\r\n<ol>\r\n<li>Add milk to a pan and heat on medium flame.</li>\r\n<li>Add lemon 1 tbsp at a time and then cheese start to form.</li>\r\n<li>Then collect all the formed cheese and drain it using a strainer.</i>\r\n<li>After removing the liquid you can store the cheese for 7 days.</li>\r\n</ol>\r\n</td></tr>\r\n</table>\r\n</center>', 'shameera');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(32, 'Caramel Dessert Cup', , 'Pouch', 'The Best Caramel Cup recipe ever on the internet', '<center>\r\n<table border=\"1\" cellpadding=\"15\">\r\n<tr><td>\r\n<h3>Ingrediants:</h3>\r\n<ol>\r\n<li><i>milk - 1cup</i></li>\r\n<li><i>corn flour - 2tbsp</i></li>\r\n<li><i>sugar - 1/4cup</i></li>\r\n<li><i>butter - 2tbsp</i></li>\r\n</ol><br>\r\n<h3>Method:</h3>\r\n<ol>\r\n<li>Add corn flour to milk and mix well.</li>\r\n<li>Caramalized the sugar and add butter. Then add milk mixture.</li>\r\n<li>Keep stir on medium flame. Cook until thickens.</li>\r\n<li>Finally add to the cups evenly and refrigerate.</li>\r\n</ol>\r\n</td></tr>\r\n</table>\r\n</center>\r\n', 'shameera');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(33, 'Chocolate Dessert Cup', , 'Pouch', 'Try the best Chocolate Dessert Cup on the internet with BookWorm Pouch', '<center>\r\n<table border=\"1\" cellpadding=\"15\">\r\n<tr><td>\r\n<h3>ingrediants:</h3>\r\n<ol>\r\n<li><i>corn flour - 2tbsp</i></li>\r\n<li><i>sugar - 4tbsp</i></li>\r\n<li><i>salt - 1/8 tsp</i></li>\r\n<li><i>salt - 1/8 tsp</i></li>\r\n<li><i>chocolate - 1/4cup</i></li>\r\n</ol><br>\r\n<h3>method:</h3>\r\n<ol>\r\n<li>Mix corn flour, sugar and salt then add milk. Mix all well.</li>\r\n<li>Add chocolate and keep stirring on medium flame.</li>\r\n<li>Cook until thickens.</li>\r\n<li>Then pour into separate cups and refrigerate.</li>\r\n</ol>\r\n</td></tr>\r\n</table>\r\n</center>', 'shameera');
INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(34, 'Crooner', , 'Article', 'An article for your motivation. Life is experience', 'Tony Gardner had been my motherâ€™s favourite. Back home, back in the communist days, it had been really hard to get records like that, but my mother had pretty much his whole collection. Once when I was a boy, I scratched one of those precious records. The apartment was so cramped, and a boy my age, you just had to move around sometimes, especially during those cold months when you couldnâ€™t go outside. So I was playing this game jumping from our little sofa to the armchair, and one time I misjudged it and hit the record player.<br><br>\r\nThe needle went across the record with a zipâ€”this was long before CDsâ€”and my mother came in from the kitchen and began shouting at me. I felt so bad, not just because she was shouting at me, but because I knew it was one of Tony Gardnerâ€™s records, and I knew how much it meant to her. And I knew that this one too would now have those popping noises going through it while he crooned those American songs. Years later, when I was working in Warsaw and I got to know about black-market records, I gave my mother replacements of all her worn-out Tony Gardner albums, including that one I scratched.<br><br>\r\nIt took me over three years, but I kept getting them, one by one, and each time I went back to see her Iâ€™d bring her another.', 'kaveen');
