INSERT INTO `tbl_archive` (`book_id`, `book_name`, `book_img`, `book_type`, `book_description`, `book_content`, `author_name`) VALUES
(36, 'Chocolate Mousse', , 'Pouch', 'Try the best Chocolate mousse, wake your taste testers!', '<center>\r\n<table border=\"1\" cellpadding=\"15\">\r\n<tr><td>\r\n<h3>ingrediants:</h3>\r\n<ol>\r\n<li><i>corn flour - 2tbsp</i></li>\r\n<li><i>sugar - 4tbsp</i></li>\r\n<li><i>salt - 1/8 tsp</i></li>\r\n<li><i>salt - 1/8 tsp</i></li>\r\n<li><i>chocolate - 1/4cup</i></li>\r\n</ol><br>\r\n<h3>method:</h3>\r\n<ol>\r\n<li>Mix corn flour, sugar and salt then add milk. Mix all well.</li>\r\n<li>Add chocolate and keep stirring on medium flame.</li>\r\n<li>Cook until thickens.</li>\r\n<li>Then pour into separate cups and refrigerate.</li>\r\n</ol>\r\n</td></tr>\r\n</table>\r\n</center>', 'kaveen');

